function InfoCard() {
    return (
      <div className="flex justify-center md:justify-start">
        <p className="text-center md:text-left">
          I am an ambitious student pursuing a B.S. in Computer Science with a
          minor in Mathematics, driven by a passion for technology and
          continuous learning. With a proven track record of excelling in
          coursework and thriving in team-based projects, I possess strong
          problem-solving and communication skills. Confident in my ability to
          overcome challenges, I am equipped with a solid foundation in
          programming languages and computer science principles.
        </p>
      </div>
    );
}

export default InfoCard;
